export default class MyApp extends App {
    render () {
        <Layout>
              <div>
                <style jsx>{`
                    .map-container {
                        position: absolute;
                        width: 100%;
                        height: 100%;
                    }
                    `}</style>
                    <div ref={this.mapContainer} className="map-container" />
                </div>
            <title>Hik'UP Admin</title>

        </Layout>
    }
}
